import React from "react";
import { Grid, Stack, Typography, Box, Avatar } from "@mui/material";
import { Container } from "@mui/material";
import Link from "@mui/material/Link";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import { Separator, CommonHeader, theme } from "../styles/theme";
import img from "../images/Frame 38557.png";
import img1 from "../images/Group 21027.png";
import Imgcarousel from "../utili/carousal/Imgcarousel";

export default function Testimonials() {
  return (
    <>
      <Container maxWidth="xl">
        <Separator />
        {/* Damage Protection Plans headers */}
        {/* <Grid container sx={{ paddingX: "30px" }}>
          <Grid item md={12} sm={12} xm={12} lg={12}>
            <Box component="div" className="port-content">
              <CommonHeader className="CommonHeader">
                Why NoQA Warranty?
              </CommonHeader>
            </Box>
          </Grid>
        </Grid> */}

        {/* image container */}

        <Grid container sx={{ paddingX: "30px" }}>
          <Grid item md={12} sm={12} xm={12} lg={12}>
            <Box
              component="div"
              sx={{
                display: "flex",
                justifyContent: "space-between",
                alignContent: "center",
                flexDirection: "row",
                paddingY: "10px",
                [theme.breakpoints.down("sm")]: {
                  display: "flex",
                  justifyContent: "space-between",
                  alignContent: "center",
                  flexDirection: "column",
                },
              }}
            >
              <div>
                <img src={img} alt="family image" width="100%" />
              </div>
              <div style={{ background: "#4FC5EB" }}>
                <img
                  src={img1}
                  alt="family image"
                  width="100%"
                  style={{ padding: "20px 10px 0px 0px" }}
                />
              </div>
            </Box>
          </Grid>
        </Grid>
      </Container>

      {/* testimonial */}
      <Container maxWidth="xl">
        <Separator />
        {/* Damage Protection Plans headers */}
        <Grid container sx={{ paddingX: "30px" }}>
          <Grid item md={12} sm={12} xm={12} lg={12}>
            <Box component="div" className="port-content">
              <CommonHeader className="CommonHeader">Our Clients</CommonHeader>
            </Box>
          </Grid>
        </Grid>

        {/* image container */}

        <Grid container>
          <Grid item md={12} sm={12} xm={12} lg={12} sx={{ paddingX: "10px" }}>
            <Imgcarousel />
          </Grid>
        </Grid>
      </Container>

      {/* client */}

      <Container maxWidth="xl">
        <Separator />
       
        <Grid container sx={{ paddingX: "30px" }}>
          <Grid item md={12} sm={12} xm={12} lg={12}>
            <Box
              component="div"
              sx={{
                display: "flex",
                justifyContent: "space-between",
                alignContent: "center",
                flexDirection: "row",
                paddingY: "10px",
                [theme.breakpoints.down("sm")]: {
                  display: "flex",
                  justifyContent: "space-between",
                  alignContent: "center",
                  flexDirection: "column",
                },
              }}
            >
              <div>
                <img src={img} alt="family image" width="100%" />
              </div>
              <div style={{ background: "#4FC5EB" }}>
                <img
                  src={img1}
                  alt="family image"
                  width="100%"
                  style={{ padding: "20px 10px 0px 0px" }}
                />
              </div>
            </Box>
          </Grid>
        </Grid>
      </Container>
    </>
  );
}
